iPhone과 Mac을 위한 최고의 음악 플레이어!
SoundCloud®, Spotify, iTunes 그리고 당신의 콜렉션을 최고의 품질로 한곳에서 모두 감상 할 수 있습니다.

주요 특징:

- VOX Premium.
• VOX Cloud 는 당신만을 위한 개인적인 음악 스토리지 공간입니다. 제한 없는 저장공간을 제공하며 당신의 파일을 임의로 압축하지 않습니다! Mac과 iPhone을 오가며 최고 품질을 유지한 채로 재생목록을 동기화 하고 재생 할 수 있습니다.

 – 가지고 있던 파일 그대로 들으세요, VOX는 대부분의 인기 오디오 포맷들을 모두 지원합니다.
• 무손실: FLAC, APE, WAV, ALAC, etc. and Lossy: MP3, WMA, OGG, etc. BASS™ 오디오 엔진을 통해 Hi-Res 음원의 손실 없는 깔끔한 소리를 전달합니다.


– 당신이 즐겨찾는 모든 서비스를 품은 All-in-one 뮤직 플레이어
• iTunes 재생목록;
• 개인FLAC 컬렉션; 
• SoundCloud®, Spotify 스트리밍 지원;
• 30'000+ 온라인 라디오 방송국; 
  … 그리고 더  :-).

– 새로운 사용자 경험을 제공하는 유니크한 디자인
• 제스쳐 기반 인터페이스;
•갭리스 재생 지원;
• AirPlay 스트리밍 지원; 
• 세밀한 sound Equalizer; 
• Offline Mode 제공; 
• CarPlay support;
• 친구들과 음악 공유 (for SoundCloud®).

VOX Premium 는 자동 구독 갱신형 상품으로 제공됩니다.:
– $4.99 (매달);
– $49.99 (1년).

귀하의 iTunes계정에 등록된 신용카드를 통해 요금이 부과됩니다. 구독이 종료되기 최소 24시간 전에 자동 갱신이 해제되어 있지 않으면 자동으로 구독이 갱신됩니다.
구매 후 iTunes 계정 설정에서 구독 정보를 관리 할 수 있습니다. 구독 활성 기간 중에는 구독을 취소 할 수 없습니다. 

VOX 음악 플레이어 개인 정보 보호 정책을위한 루프 : https://vox.rocks/privacy
VOX Music Player 이용 약관 : https://vox.rocks/terms

P.S.: FLAC Player, ALAC Player, Lossless Player, SoundCloud® 스트리밍 솔루션, Hi-Res audio Player – 이 모든것을 VOX Music Player 하나로 함께하세요.

